import Foundation

/*
 parse extensions.yml and mimetypes.yml from
 https://github.com/digipres/digipres.github.io

 to refresh mime types for the future
 */
public func parseYMLData() {
    let packageURL = URL(fileURLWithPath: #file).deletingLastPathComponent()
    let extensionsFileURL = packageURL.appendingPathComponent("extensions.yml")
    let mimeFileURL = packageURL.appendingPathComponent("mimetypes.yml")
    
    do {
        var testData = try Data(contentsOf: extensionsFileURL)
        var ymlFile = String(data: testData, encoding: .utf8)
        var lines = ymlFile?.split(separator: "\n").map({ String($0) })
        var extensions = [String: [String]]()
        var currentLine = ""
        
        for (_, line) in lines!.enumerated() {
            let trimmedLine = line.trimmingCharacters(in: .whitespacesAndNewlines)
            
            if
                (!trimmedLine.contains("identifiers:") &&
                !trimmedLine.contains("formatId:") &&
                !trimmedLine.contains("regId:") &&
                !trimmedLine.contains("name:") &&
                !trimmedLine.starts(with: "'*.")) ||
                    trimmedLine.starts(with: "'*.")
            {
                currentLine = trimmedLine
                                    .replacingOccurrences(of: "'", with: "")
                                    .replacingOccurrences(of: "*", with: "")
                                    .replacingOccurrences(of: ".", with: "")
                                    .replacingOccurrences(of: ":", with: "")
                                    .replacingOccurrences(of: " ", with: "")
                extensions[currentLine] = [String]()
            }
            if trimmedLine.contains("formatId") {
                let splitted = trimmedLine.components(separatedBy:  "- formatId: ")
                extensions[currentLine]?.append(splitted[1])
            }
        }
       
        testData = try Data(contentsOf: mimeFileURL)
        ymlFile = String(data: testData, encoding: .utf8)
        
        lines = ymlFile?.split(separator: "\n").map({ String($0) })
        var mimeTypes = [String: [String]]()
        currentLine = ""
        
        for (_, line) in lines!.enumerated() {
            let trimmedLine = line.trimmingCharacters(in: .whitespacesAndNewlines)
            if
                !trimmedLine.contains("- id:") &&
                !trimmedLine.contains("identifiers:") &&
                !trimmedLine.contains("formatId:") &&
                !trimmedLine.contains("regId:") &&
                !trimmedLine.contains("sort_depth:") &&
                !trimmedLine.contains("sort_key:") &&
                !trimmedLine.contains("supertype:") &&
                    !trimmedLine.isEmpty &&
                !trimmedLine.starts(with: "- - ")
            {
                print(trimmedLine)
            }
        
            if trimmedLine.starts(with: "- - ") {
                currentLine = trimmedLine
                                    .replacingOccurrences(of: "'", with: "")
                                    .replacingOccurrences(of: "- -  ", with: "")
                                    .replacingOccurrences(of: "- - ", with: "")
                mimeTypes[currentLine] = [String]()
            }
            if trimmedLine.contains("formatId") {
                let splitted = trimmedLine.components(separatedBy:  "- formatId: ")
                mimeTypes[currentLine]?.append(splitted[1])
            }
        }
        
        var finalMime = [String: [String]]()
        for (mimeKey, mimeFormats) in mimeTypes {
            finalMime[mimeKey] = [String]()
            for (extKey, extFormats) in extensions {
                let commonElements = mimeFormats.filter{ extFormats.contains($0) }
                if !commonElements.isEmpty {
                    finalMime[mimeKey]?.append(extKey)
                }
            }
        }
        
        print(finalMime)
    }
    catch {
        print("error", error)
    }
}

public func mimeType(for ext: String) -> [String] {
    var results = [String]()
    for (key, exts) in types {
        if exts.contains(ext) {
            results.append(key)
        }
    }
    return results
}

